import React, { useEffect, useState } from 'react';
import { getOrdenes, getOrdenesDeleted, postDeleteOrden, postRecoverOrden } from "../../Utils/Orden";

import { getVehiculosDeleted, postRecoverVehiculo } from "../../Utils/Vehiculo";
import RecoverTable from '../Partials/RecoverTable';

export default function OrdenTablaEliminados(props) {
    const { table } = props;
    return (
        <RecoverTable
            fetchGet={getVehiculosDeleted}
            recoverFetch={postRecoverVehiculo}
            table={table}
            changeFrame={props.changeFrame}
            id="patente"
            vocabulary={{
                singular: "vehiculo",
                id: ["patente"],
                pronombre: "el"
            }}
        />
    )
};
